import React from "react";
import "./Card.scss";

function Card(props) {
  console.log(props);
  return (
    <div className="card">
      <article>
        <h2>
          {props.coinName}({props.coinSymbol})
        </h2>
        <p>
          ${props.coinPrice}USD per {props.coinSymbol}
        </p>
      </article>
    </div>
  );
}

export default Card;
